import React from 'react';

const Footer = () => {
  return (
    <footer className="bg-dark text-light p-4 text-center">
      <div className="container">
        <h3> VatsalyaExpress : A  Digital Platform To Adopt Pet Animals</h3>
        <p></p>
        <p> Copyright &copy; 2023 Narendra Kumar Patel  </p>
        <p>Contact us: Support@Vatsalya@gmail.com</p>
      </div>
    </footer>
  );
};

export default Footer;
